import React from 'react'

const UnitsList = (props) => {

  const myArray = Array.from(props.items.costs);
  alert(myArray);

  return (
    <li>
            <h2>{props.id}</h2>
            <h3>{props.name}</h3>
            <p>{props.age}</p>
            {myArray.map((element) => (
              <p>{myArray[element]}</p>)
            )}
        </li>
  );
};

export default UnitsList;
